import styled from 'styled-components';
import { motion } from 'framer-motion';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';
import CoverSlide from './slides/CoverSlide';
import BigIdeaSlide from './slides/BigIdeaSlide';
import MarketStrategiesSlide from './slides/MarketStrategiesSlide';
import RevenuePotentialSlide from './slides/RevenuePotentialSlide';
import PartnershipsSlide from './slides/PartnershipsSlide';
import DeliverableSlide from './slides/DeliverableSlide';
import ViralStrategySlide from './slides/ViralStrategySlide';

const PitchDeck = () => {
  const captureSlide = async (element) => {
    const canvas = await html2canvas(element, {
      scale: 2,
      useCORS: true,
      logging: false,
      allowTaint: true,
      backgroundColor: '#0A0A0F',
      width: 1920,
      height: 1080,
      windowWidth: 1920,
      windowHeight: 1080
    });
    return canvas.toDataURL('image/jpeg', 1.0);
  };

  const downloadPDF = async () => {
    const pdf = new jsPDF({
      orientation: 'landscape',
      unit: 'mm',
      format: 'a4',
      compress: true
    });

    const slides = document.querySelectorAll('.slide');
    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = pdf.internal.pageSize.getHeight();

    for (let i = 0; i < slides.length; i++) {
      try {
        if (i > 0) {
          pdf.addPage();
        }

        // Fill background
        pdf.setFillColor(10, 10, 15); // #0A0A0F in RGB
        pdf.rect(0, 0, pdfWidth, pdfHeight, 'F');
        
        const imgData = await captureSlide(slides[i]);
        
        // Calculate dimensions to maintain aspect ratio and fill width
        const aspectRatio = 16/9;
        const imgWidth = pdfWidth;
        const imgHeight = pdfWidth / aspectRatio;
        const yOffset = (pdfHeight - imgHeight) / 2;
        
        pdf.addImage(imgData, 'JPEG', 0, yOffset, imgWidth, imgHeight);
        
      } catch (error) {
        console.error(`Error capturing slide ${i}:`, error);
      }
    }

    pdf.save('Wizkid_Crypto_Pitch_Deck.pdf');
  };

  return (
    <>
      <ExportButton onClick={downloadPDF}>
        Export to PDF
      </ExportButton>
      <DeckContainer>
        <SlideWrapper className="slide">
          <SlideContent>
            <CoverSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <BigIdeaSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <MarketStrategiesSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <RevenuePotentialSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <PartnershipsSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <DeliverableSlide />
          </SlideContent>
        </SlideWrapper>
        <SlideWrapper className="slide">
          <SlideContent>
            <ViralStrategySlide />
          </SlideContent>
        </SlideWrapper>
      </DeckContainer>
    </>
  );
};

const DeckContainer = styled.div`
  width: 100%;
  max-width: 100%;
  margin: 0;
  padding: 0;
  background: ${props => props.theme.colors.background};
`;

const SlideWrapper = styled.div`
  height: 100vh;
  width: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  margin: 0;
  padding: 0;
  overflow: hidden;
  position: relative;
  background: ${props => props.theme.colors.background};
`;

const SlideContent = styled.div`
  width: 1920px;
  height: 1080px;
  display: flex;
  align-items: center;
  justify-content: center;
  transform-origin: center;
  transform: scale(0.6);
  background: ${props => props.theme.colors.background};
  padding: 40px;
  margin: 100px 0;
`;

const ExportButton = styled.button`
  position: fixed;
  top: 20px;
  right: 20px;
  z-index: 1000;
  background: ${props => props.theme.colors.gradient.primary};
  color: ${props => props.theme.colors.secondary};
  border: none;
  padding: 12px 24px;
  border-radius: 12px;
  font-size: 1rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  box-shadow: ${props => props.theme.shadows.card};

  &:hover {
    transform: translateY(-2px);
    box-shadow: ${props => props.theme.shadows.card}, 0 0 15px rgba(255, 215, 0, 0.3);
  }
`;

export default PitchDeck;
